import React from "react";

import Points from "./Points";

const Features = () => {
  return (
    <div id="features">
      <h2>All information that you need</h2>
      <h2>in your pocket</h2>
      <ul>
        <li>Notification system</li>
        <li>You can filter </li>
      </ul>
      <Points />
    </div>
  );
};

export default Features;
